  03> NEWLAND, David Bruce m on 14.11.1970 to HICKEY, Janet
  b 25.01.1945
  b 30.10.1950
  Bruce b. at Waverley. Divorced. Janet, d/o David and Joyce Hickey. Address: "Bankhead", Karahaki
  Road, Waverley.
  Bruce is farming on "Bankhead" which is run in partnership with his brother, Alan.
  01> NEWLAND, Heath David
  b 18.06.1971
  02> NEWLAND, James Kemp
  b 16.12.1973
  Address: 67 Kilkenay Drive, Howick, Auckland.
  James was educated at St Kentigern School in Auckland then had a year at Taratahi Farm School
  at Masterton. He worked on farms and is now a trainee greenkeeper at the Remuera Golf Course.
  03> NEWLAND, Nicholas Matthew
  b 03.03.1978 d **.07.1980
  04> NEWLAND, Alan John m on 16.10.1971 to HONEYFIELD, Sally
  b 17.07.1946
  b 13.11.1950
  Alan b. at Waverley and m. at St George's Church, Patea. Sally, d/o Geoffrey Earl Honeyfield and
  Marjorie Vera Lupton. Address: Kohi Road, RD 1, Waverley.
  Alan was educated at Feilding Agricultural High School and is farming at "Putahi", Waverley in
  partnership with his brother, Bruce. Sally was educated at St Mary's School, Stratford and is a
  school dental nurse.
  01> NEWLAND, Philip Justin
  b 09.09.1974
  Justin b. at Patea. He completed four years at Feilding Agricultural High School and had a
  year at Taratahi Farm Training School at Masterton. He is now back in Waverley working on the
  farms of his father, Alan and uncle, Bruce. He plays rugby and golf.
  02> NEWLAND, Natalie Jane
  b 21.03.1977
  Natalie b, at Patea. She had four years of education at St Mary's School, Stratford and part of
  a year at Wanganui Girls' College before starting an apprenticeship as a hairdresser. She is
  now an administration assistant at Waitotara Meat Company in Wanganui.
  05> NEWLAND, Elizabeth Mary
  b 27.03.1949 d 05.05.1951
  06> NEWLAND, Jocelyn Mary m on 03.06.1978 to REMETIS, Peter
  b 21.03.1953
  b 19.07.1946
  Jocelyn b. at Waverley and m. at St Stephen's Church, Waverley, Peter, slo Francis Joseph Remetis
  (of Russian descent) and Joan Barclay Millar, b. at Otahuhu. Address: 33 Jellicoe Parade, Waiheke
  Island, Auckland.
  Jocelyn worked in the cerebral palsy unit at Queen Elizabeth Hospital, Rotorua and then at The Nest
  (Salvation Army children's home), Hamilton before completing her nursing training in Hamilton. She
  worked for 14 years in a private hospital and rest home in Epsom, Auckland. She is now head
  housekeeper at a tourist resort on Waiheke Island.
